import './App.css';

function App() {
  return (
    <div>
    <section id='goal-form'>
      <form>
        <div className='form-control'>
          <label>Course Goal</label>
          <input type="text"></input>
        </div>
        <button type='submit' className='button'></button>
      </form>
    </section>
    <section id='goals'>
      <ul className='goal-list'>
        <li className='goal-item'>오늘의 할 일1</li>
        <li className='goal-item'>오늘의 할 일2</li>
      </ul>
    </section>
    </div>
  );
}

export default App;
